import java.util.Scanner;

public class Fibonacci {
    public static void main(String[] args) {
        long a = 0, b = 1, c;
        System.out.print("Fibonacci Series: ");
        System.out.print(a + " ");
        System.out.print(b + " ");
        while (b <= 100) {
            c = a + b;
            System.out.print(c + " ");
            a = b;
            b = c;
        }
        System.out.println();
    }
}
